   // Distância euclidiana burra
   function euclidean_canonical_very_dumb($u, $v)
   {
      $distance = 0;
      
      for ($i = 0; $i < 2000; $i++)
         $distance += ($u[$i] - $v[$i]) * ($u[$i] - $v[$i]);
      
      return $distance;
   }
   
   // Distância euclidiana não tão burra
   function euclidean_canonical_not_that_dumb($u, $v)
   {
      $distance = 0;
      
      for ($i = 0; $i < 2000; $i++)
      {
         $dif = $u[$i] - $v[$i];
         $distance += $dif * $dif;
      }
      
      return $distance;
   }
   
   // Distância euclidiana usando produto interno e vetores normais
   function euclidean_smart($u, $v)
   {
      $inner_prod = 0;
      
      // Calcula <u,v>
      for ($i = 0; $i < 2000; $i++)
         $inner_prod += $u[$i] * $v[$i];
      
      return 2 * (1 - $inner_prod);
   }
   
   // Função de similaridade por produto entre ângulo e norma
   function similarity1($u, $v)
   {
      $inner_prod = 0;
      
      for ($i = 0; $i < 2000; $i++)
         $inner_prod += $u[$i] * $v[$i];
         
      return 0.5 * (1 - $inner_prod * (1 + 2 * $inner_prod));
   }
   
   // Transforma um descritor do formato do banco de dados (string) em um vetor de floats
   function calculateFloatVector($desc){
      $array = str_split($desc, 16);
      return $array;
   }
